userImageConsentText=\u206A\u206A\u206A\u200D\u200B\u200C\u200C\u200C\u200B\u200B\u200B\u200D\u200B\u200D\u200D\u200C\u200D\u200B\u200C\u200D\u200B\u200B\u200C\u200D\u200B\u200B\u200C\u200C\u200D\u200B\u200D\u200B\u200D\u200D\u200C\u200C\u200D\u200C\u200B\u200D\u200C\u200B\u200B\u206AIf you have uploaded a profile image to SAP Jam, you can display it in the launchpad as well.\nDo you want to use your SAP Jam image in the launchpad?\n\nYou can change this at any time in the Settings dialog box.\u206A\u206A
userImageConsentDialogShowTermsOfUse=\u206A\u206A\u206A\u200C\u200C\u200B\u200D\u200C\u200C\u200C\u200C\u200B\u200D\u200B\u200D\u200D\u200C\u200C\u200B\u200D\u200C\u200B\u200B\u200D\u200C\u200D\u200D\u200B\u200D\u200B\u200B\u200C\u200D\u200C\u200C\u200C\u200D\u200B\u200D\u200C\u200C\u200D\u200B\u200B\u206AShow Terms of Use\u206A\u206A
